import { Container, Item } from "./styles";

const FilterMenu = () => {
  return (
    <Container>
      <Item>
        Tudo
      </Item>
      <Item>
        Ao vivo
      </Item>
      <Item>
        Música
      </Item>
      <Item>
        Música Lo-fi
      </Item>
    </Container>
  )
}

export default FilterMenu;
